import React from "react";
import SingUp from "../signup/signup";
import Login from "../login/login";
import './paginaInicial.css'

const PaginaInicial =()  =>{
    return(
        <div>
            <SingUp/>
            <Login/>
            <label class="switch">
                <input type="checkbox"></input>
                <span class="slider round"></span>
            </label>

        </div>
    )
}

export default PaginaInicial
